    "2015-09-26T21:00:30.266029",nt"name": "u-s-annual-climatological-summaries",nt"isopen":
    false,nt"url": null,nt"notes": "Annual Climatological Summary contains
    historical monthly and annual summaries for over 8000 U.S. locations. Observing
    stations are located in the United States of America, U.S. Virgin Islands, Puerto
    Rico, and Pacific islands of the U.S. and associated nations. The major parameters
    are: monthly mean maximum, mean minimum and mean temperatures; monthly total precipitation
    and snowfall; departure from normal of the mean temperature and total precipitation;
    monthly heating and cooling degree days; number of days that temperatures and precipitation
    are above or below certain thresholds; and extreme daily temperature and precipitation
    amounts. Annual Climatological Summary is derived from the NCDC Summary of the Month
    dataset (DSI-3220).",nt"license_title": null,nt"extras": [{ntt"key":
